static Handler3_T donor_plus_table[32] =
  {donor_plus_00, donor_plus_01, donor_plus_02, donor_plus_03,
   donor_plus_04, donor_plus_05, donor_plus_06, donor_plus_07,
   donor_plus_08, donor_plus_09, donor_plus_10, donor_plus_11,
   donor_plus_12, donor_plus_13, donor_plus_14, donor_plus_15,
   donor_plus_16, donor_plus_17, donor_plus_18, donor_plus_19,
   donor_plus_20, donor_plus_21, donor_plus_22, donor_plus_23,
   donor_plus_24, donor_plus_25, donor_plus_26, donor_plus_27,
   donor_plus_28, donor_plus_29, donor_plus_30, donor_plus_31};

double
Maxent_hr_donor_prob (Univcoord_T splice_pos, Univcoord_T chroffset) {
  Univcoord_T startpos;
  Univcoord_T ptr;
  int shift;
  Genomecomp_T high, low, nextlow;
  double refprob, altprob;
#ifdef DEBUG
  char g_alt;
#endif
  

  if (splice_pos < chroffset + DONOR_MODEL_LEFT_MARGIN) {
    return 0.0;
  } else {
    startpos = splice_pos - DONOR_MODEL_LEFT_MARGIN;
    ptr = startpos/32U*3;
    shift = startpos % 32;

    debug(printf("splice_pos = %u, donor dinucleotide is %c%c\n",
		 splice_pos,Genome_get_char_blocks(&g_alt,splice_pos),Genome_get_char_blocks(&g_alt,splice_pos + 1)));

    debug(Genome_print_blocks(ref_blocks,startpos,startpos+9));
    debug(printf("startpos is %u, shift is %d\n",startpos,shift));

#ifdef WORDS_BIGENDIAN
    high = Bigendian_convert_uint(ref_blocks[ptr]);
    low = Bigendian_convert_uint(ref_blocks[ptr+1]);
    nextlow = Bigendian_convert_uint(ref_blocks[ptr+4]);
#else
    high = ref_blocks[ptr];
    low = ref_blocks[ptr+1];
    nextlow = ref_blocks[ptr+4];
#endif
    refprob = (donor_plus_table[shift])(low,high,nextlow);

    if (snp_blocks == NULL) {
      return refprob;
    } else {
#ifdef WORDS_BIGENDIAN
      high = Bigendian_convert_uint(snp_blocks[ptr]);
      low = Bigendian_convert_uint(snp_blocks[ptr+1]);
      nextlow = Bigendian_convert_uint(snp_blocks[ptr+4]);
#else
      high = snp_blocks[ptr];
      low = snp_blocks[ptr+1];
      nextlow = snp_blocks[ptr+4];
#endif

      if ((altprob = (donor_plus_table[shift])(low,high,nextlow)) > refprob) {
	return altprob;
      } else {
	return refprob;
      }
    }
  }
}

